terms of the GNU GPL, v2 or later.","--  Thanks to trepan (Dave Rodgers) for the original CommanderEnds widget","--","--------------------------------------------------------------------------------","--------------------------------------------------------------------------------","","function widget:GetInfo()","\treturn {","\t\tname = \"GameTypeInfo\",","\t\tdesc = \"informs players of the game type at start\",","\t\tauthor = \"Teutooni. Optimizations by Psyborg, 2024\",","\t\tdate = \"Jul 6, 2008\",","\t\tlicense = \"GNU GPL, v2 or later\",","\t\tlayer = 0,","\t\tenabled = true","\t}","end","","local vsx, vsy = Spring.GetViewGeometry()","local widgetScale = 0.80 + (vsx * vsy / 6000000)","","local glPopMatrix = gl.PopMatrix","local glPushMatrix = gl.PushMatrix","local glScale = gl.Scale","local glTranslate = gl.Translate","local spGetGameSeconds = Spring.GetGameSeconds","","local messages = {}","","local font","","local draftMode = Spring.GetModOptions().draft_mode","","function widget:ViewResize()","\tvsx, vsy = Spring.GetViewGeometry()","\twidgetScale = (0.80 + (vsx * vsy / 6000000))","","\tfont = WG['fonts'].getFont(nil, 1.5, 0.25, 1.25)","","\tif messages[1] then","\t\tmessages[1].x = widgetScale * 60","\t\tmessages[1].y = widgetScale * 15.5","\tend","","\tif messages[2] then","\t\tmessages[2].x = 100 * widgetScale","\t\tmessages[2].y = 15.5 * widgetScale","\tend","","\tif messages[3] then","\t\tmessages[3].x = 40 * widgetScale","\t\tmessages[3].y = 13 * widgetScale","\tend","end","","function widget:Initialize()","\tif Spring.GetModOptions().deathmode == \"neverend\" then","\t\twidgetHandler:RemoveWidget()","\t\treturn","\tend","","\tmessages[1] = {}","","\tif Spring.GetModOptions().deathmode == \"own_com\" then","\t\tmessages[3] = {}","\tend","","\t-- Call once manually to set the initial positions","\twidget:LanguageChanged()","\twidget:ViewResize()","end","","function widget:LanguageChanged()","\tlocal key","\tlocal deathmode = Spring.GetModOptions().death